  \"FY08 Environmental Contaminants Program Off-Refuge Investigation : Final report
  : Assessment of trace-metal exposures to aquatic biota from historical mine sites
  in the Western Great Basin\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:24:59.512368\",\n\t\"name\": \"fy08-environmental-contaminants-program-off-refuge-investigation-final-report-assessment-o\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this investigation is to
  identify and characterize the nature and extent of sediment and food chain contamination,
  and to determine the potential for adverse effects to aquatic life, from metals
  in drainage emanating from current and historical mine sites. To achieve this purpose,
  this investigation accomplished the following tasks: 1) determination of metals
  and trace elements in water, sediment, aquatic benthic invertebrates, and fish tissues;
  2) aquatic invertebrate community assessment; 3) fish community assessment; and
  4) fish health assessment.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
